import { useState } from "react";


export const AddUser = () => {
  const [nome, setNome] = useState("");
  const [email, setEmail] = useState("");
  const [dataDeNascimento, setDataDeNascimento] = useState("");
  const [cpf, setCpf] = useState("");

  const handleNome = (nome) => setNome(nome.target.value);
  const handleEmail = (email) => setEmail(email.target.value);
  const handleDataDeNascimento = (dataDeNascimento) => setDataDeNascimento(dataDeNascimento.target.value);
  const handleCpf = (cpf) => setCpf(cpf.target.value);

  return (
    <div>
      <h1>Cadastrar Pessoa</h1>
      <div>
         <label for="nome">Nome</label>
         <input id="nome" name="nome" type="text" placeholder="Digite o nome" onChange={handleNome} value={nome}/>
      </div>
      <div>
         <label for="email">E-mail</label>
         <input id="email" name="email" type="text" placeholder="Digite o e-mail" onChange={handleEmail} value={email}/>
      </div>
      <div>
         <label for="dataDeNascimento">Data de Nascimento</label>
         <input id="dataDeNascimento" name="dataDeNascimento" type="text" placeholder="Digite a data de nascimento" onChange={handleDataDeNascimento} value={dataDeNascimento}/>
      </div>
      <div>
         <label for="cpf">CPF</label>
         <input id="cpf" name="cpf" type="text" placeholder="Digite o CPF" maxLength="11" onChange={handleCpf} value={cpf}/>
      </div>


      <div>
        <button type="submit">Adicionar Usu√°rio</button>
      </div> 
    </div>
    )
}
